import styled from 'styled-components'


export const ContainerPai= styled.div`
display: flex;
position: absolute;
/* overflow: hidden; */
align-items: center;
justify-content: center;
/* padding: 0 50px; */
/* margin: 0; */
height: 1vh;
/* top:0; */
`
export const TituloPrincipal= styled.h1`
display: flex;
top: 0;
color:#070809;
font-size: 2.3rem;
font-weight: 700;
`
export const Imagem=styled.img`
margin-left: 50px;;
`
